import './App.css';
import UserRegistrationForm from "./components/Users/userRegistrationForm"
import { BrowserRouter, Switch, Router, Route } from 'react-router';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route path="/register" component={UserRegistrationForm} />
        </Switch>
      </BrowserRouter>

    </div>
  );
}

export default App;
